import './App.css';

function App(pros) {
  return (
    <div className="App">
      <h2>{pros.texto}</h2>
    </div>
  );
}

function H2array(pros) {
  return (
    <div className="H2array">
      <h2>{pros.texto.nome}</h2>
      <h2>{pros.texto.sobrenome}</h2>
    </div>
  );
}

export default App & H2array;
